import logo from './logo.svg';
import './App.css';
import BG from './Images/BG.jpg'
function App() {
  return (
    <div className="App">
      <div>
      <img src={BG} className="App-logo" alt="logo" />
      </div>
      <div>
      <h1 className='imageText'>Test</h1>
      </div>

    </div>
  );
}

export default App;
